    "Population trends and productivity of fulmars, cormorants, kittiwakes and murres
    in the Pribilof Islands, Alaska in 1985",nt"tracking_summary": {ntt"total":
    2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:54.402754",nt"name": "population-trends-and-productivity-of-fulmars-cormorants-kittiwakes-and-murres-in-the-prib",nt"isopen":
    false,nt"url": null,nt"notes": "The amount of potentially disturbing activity
    in the vicinity of the Pribilof Islands and the legal mandates concerning protection
    of the seabird colonies there makes the area high priority for long-term monitoring.
    The available data on reproductive success for cormorants, murres, and kittiwakes
    is becoming sufficiently extensive to provide a basis for understanding some of
    the ecological principals of the southeastern Bering Sea. Already scientists have
    used this data set to formulate hypotheses about which factors cause fluctuations
    in reproductive success (e.g. Hunt et al. 1981, Lloyd 1985). Only by understanding
    "natural" fluctuations can "man-caused" effects on the marine ecosystem be assessed.
    Information on annual reproductive success coupled with data on changes in populations
    will help managers understand the relationships between the two. We recommend that
    data on productivity and populations continue to be gathered annually for at least
    five more years at St. Paul and St. George. The intensity of the work should be
    similar to the 1985 effort for at least two more years and then reduced if evaluation
    of methods indicates less effort is needed to get the necessary information. Refuge
    personnel should conduct the annual monitoring, but independent research should
    be encouraged by other agencies or universities to address various questions about
    how the Pribilof ecosystem functions.",nt"license_title": "License Not Specified",nt"extras":
